long_desc.thetext:
"Every name first declared in a namespace is a member of that namespace. If a friend declaration in a non-local class first declares a class or function, the friend class or function is a member of the innermost enclosing namespace." (from C++ standard 7.3.1.2.3)

For example:

namespace ns4 {

	class Class1 {
		friend void function2(Class1); <- line 1
	};
	void function2(Class1){}; <- line 2
}

findBinding("ns4::function2",...) should return function2 on line 2.  The search now returns function2 on line 1 (which really is a declaration of function2 on line 2) after recent changes made in scoping in HEAD.  I believe that's incorrect.

