In normal operation, clicking in a SWT component and dragging the pointer out of the component will result in a MouseDown received in the component and a MouseUp received in the same component when the drag finishes.  If the point is dragged across a SWT_AWT frame, the MouseUp is never received.  This only occurs on the mac.

The snippet below illustrates this.  Run the snippet and drag from the SWT Label to the desktop without crossing the AWT Label.  Notice the MouseUp event is received.  Then drag from the SWT Label across the AWT Label.  Notice the MouseUp event is not received.

public class SimpleMouseTest {
	private final static boolean DO_SWT_AWT = true;
	public static void main(String args[]) {
		Display display = new Display();
		Shell shell = new Shell(display);
		GridLayout gridLayout = new GridLayout();
		gridLayout.numColumns = 2;
		shell.setLayout(gridLayout);
		CLabel label1 = new CLabel(shell, SWT.CENTER);
		label1.setText("SWT Label");
		label1.setLayoutData(new GridData(GridData.FILL_BOTH));
		label1.addMouseListener(new MouseAdapter() {
			public void mouseDown(MouseEvent event) {
				System.out.println("mouseDown " + event);
			}
			public void mouseUp(MouseEvent event) {
				System.out.println("mouseUp " + event);
			}
		});
		Composite bridgeComposite = new Composite(shell, SWT.EMBEDDED);
		bridgeComposite.setLayoutData(new GridData(GridData.FILL_BOTH));
		java.awt.Frame frame = SWT_AWT.new_Frame(bridgeComposite);
		java.awt.Label label = new java.awt.Label("AWT Label");
		frame.add(label);
		shell.open();
		while (!shell.isDisposed()) {
			if (!display.readAndDispatch()) {
				display.sleep();
			}
		}
	}
}

Components inside a SWT_AWT Frame don't receive mouse events (mouse released, mouse entered, mouse exited, etc) until they've been clicked on at least once.

The snippet below illustrates this.  Drag from the SWT Label to the AWT Label and notice the AWT Label doesn't receive the mouseReleased.  Click on the AWT Label.  Drag again from the SWT Label to the AWT Label and notice the mouseReleased is received.

public class SimpleMouseTest {
	public static void main(String args[]) {
		Display display = new Display();
		Shell shell = new Shell(display);
		GridLayout gridLayout = new GridLayout();
		gridLayout.numColumns = 2;
		shell.setLayout(gridLayout);
		CLabel label1 = new CLabel(shell, SWT.CENTER);
		label1.setText("SWT Label");
		label1.setLayoutData(new GridData(GridData.FILL_BOTH));
		label1.addMouseListener(new MouseAdapter() {
			public void mouseDown(MouseEvent event) {
				System.out.println("mouseDown " + event);
			}
			public void mouseUp(MouseEvent event) {
				System.out.println("mouseUp " + event);
			}
		});
		Composite bridgeComposite = new Composite(shell, SWT.EMBEDDED);
		bridgeComposite.setLayoutData(new GridData(GridData.FILL_BOTH));
		java.awt.Frame frame = SWT_AWT.new_Frame(bridgeComposite);
		java.awt.Label label = new java.awt.Label("AWT Label");
		frame.add(label);
		frame.addMouseListener(new java.awt.event.MouseAdapter() {public void mousePressed(java.awt.event.MouseEvent event) {
				System.out.println("mousePressed " + event);
			}
			public void mouseReleased(java.awt.event.MouseEvent event) {
				System.out.println("mouseReleased " + event);
			}
		});
		shell.open();
		while (!shell.isDisposed()) {
			if (!display.readAndDispatch()) {
				display.sleep();
			}
		}
	}
}

