I investigated your code. You need overide the getProvider() method of TestReportPage as following:

	protected IReportProvider getProvider( )
	{
		IReportProvider provider =  (IReportProvider) editor.getAdapter( IReportProvider.class );
		if(provider == null)
		{
			provider = super.getProvider( );
		}

		return provider;
	}

The reason is a little tricky. The edior, for example layour editor or TestReportPageEditor, can work indepent. The getProvider() implementation in the editor class doens't assume it embedded into a mutlipage editorm, so you get a new model instance here. But when you embedded the editor into a mulipage editor, the model should be shared by editros for some case. This model initialized by the parent editor(mulipageEditor). You need overide the getProvider() method as above to get the provide instance in the mulipageEditor.By this, the embedded editor can get the same model instance as the layoutEditor's(also the other editor's)
