Geometry.linesIntersect(0,0,5,5,10,10,20,20) incorrectly returns true;
This is a special case because the lines are parallel. In the test, two cross products are first performed. If one of them is 0, that is OK, but if both are 0, the lines are parallel, and the result should always be false.
