Yes, I re-use the CommonNavigator view and I'm quite happy with it - so I wouldn't like to rewrite it - I just need to tweak it to SINGLE selection style.

Declarative way is not that required here, API would be sufficient. Moreover, declarative way is usually used to avoid early plug-in activation and it's not the case here since the plug-in will be loaded anyway. So I would prefer programmatic way here just because it's less error-prone - compiler will do the checks.

Currently, I was able to to get the SINGLE style by overriding createCommonViewer to the following:

    protected CommonViewer createCommonViewer(Composite parent)
    {
        CommonViewer viewer = new CommonViewer(getViewSite().getId(), parent, SWT.SINGLE
            | SWT.H_SCROLL | SWT.V_SCROLL);
        initListeners(viewer);
        // viewer.getNavigatorContentService().restoreState(memento);
        return viewer;
    }

But I'm not quite happy with it because of the following reasons:

* Basically, it's just copy-paste from the TuningNavigator class and I don't like this "initListeners" stuff. I mean that if tomorrow the implementation of the base class will change, I need to go through it again.
* Also, I had to comment out the restoreState line just because memento is private.

So what I think would be the best for me is a trivial createCommonViewer method which does _only_ the viewer creation and all implementation level methods called in some other place.

Does it look reasonable to you?

